import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <body class="page">
        <Header />
        <Main />
        <Footer />



        <template id="card-template" class="card-template">
          <li class="card__item">
            <button class="card__delete" type="button"></button>
            <img class="card__foto" src="#" alt="Фото" />
            <div class="card__text">
              <h2 class="card__title"></h2>
              <div class="card__like">
                <button class="card__heart" type="button"></button>
                <h3 class="card__like-sum">0</h3>
              </div>
            </div>
          </li>
        </template>
      </body>
    </div>
  );
}

export default App;
